import React from "react";

export default function OtherBetsBox({ categories, onPick }) {
  return (
    <div className="other-bets">
      {categories.map(cat => (
        <div key={cat.category} className="category">
          <h4>{cat.category}</h4>
          {cat.items.map(it => (
            <div key={it.id} className="item" onClick={() => onPick(it, cat)}>
              <div className="label">{it.label}</div>
              <div className="odds">{it.odds.toFixed(2)}</div>
            </div>
          ))}
        </div>
      ))}
    </div>
  );
}
